  render() {
    return (
      <div className="navBar">
        <Navbar color="light fixed-top" light expand="md">
          <NavbarBrand  href="/"><img src={require(`../assets/logo adirasa.png`)} height="90px" alt="" /> Adirasa Snack </NavbarBrand>
            <Nav className="ml-auto" navbar>
            <NavItem>
                <NavLink className="text-info" href="/login">Log In</NavLink>
              </NavItem>
           </Nav>
        </Navbar>
      </div>
    );
  }
}

export default NavigationBar;
